(5, 'Getting and Saving Data in CKEditor old', 'getting-and-saving-data-in-ckeditor-old', 'a:8:{s:6:"text02";s:423:"CKEditor helps you create content but it is the role of your website or application to deal with the data created in this way. Saving data is a server-side operation and you are free to implement the save functionality on your own, in any way you like. CKEditor is a pure JavaScript component and it does not offer anything more than JavaScript methods and events to access the data so that you could save it on the server.";s:6:"html03";s:1326:"<h2>Retrieving Data from CKEditor</h2>\n\n<p>Some applications need to handle all data on the client side, sending it to the server using their specific methods. This is what usually happens in <a href="http://docs.ckeditor.com/#!/guide/dev_inline" style="box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;">inline editing</a> — with the possibility to <a href="http://docs.ckeditor.com/#!/api/CKEDITOR-method-inline" style="box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;">create</a> and <a href="http://docs.ckeditor.com/#!/api/CKEDITOR.editor-method-destroy" style="box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;">destroy</a> CKEditor instances dynamically, CKEditor is a perfect match for Ajax applications. If this is the case, it is enough to use the JavaScript API methods to easily retrieve the editor instance data.</p>\n\n<p>To retrieve the editor data, call the <a class="docClass" href="http://docs.ckeditor.com/#!/api/CKEDITOR.editor-method-getData" rel="CKEDITOR.editor-method-getData" style="box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;">CKEDITOR.editor.getData</a> method of the editor instance. For an editor instance with an ID of editor1, this would look like the following:</p>\n";s:8:"field_01";s:44:"Saving Data in CKEditor Replacing a Textarea";s:8:"field_04";s:129:"http://www.gravatar.com/ava